import React from "react";
import "../css_styles/Navbars.css";

const Navbars = () => {
  return (
    <div className="navbar">
      <div className="navbar__list">
        <h4>Technology</h4>
      </div>
      <div className="navbar__">
        <input placeholder="search" />
      </div>
      <div className="navbar__list">
        <h4>My Logo</h4>
      </div>
    </div>
  );
};

export default Navbars;
